function Actions() {
  return (
    <section className="container">
      <h1 className="page-title">Nos actions</h1>
      <p>
        Découvrez les différentes actions menées par Les Colis du Cœur pour
        lutter contre la précarité et soutenir les personnes dans le besoin.
      </p>
      <p>
        (Cette page sera bientôt remplie avec le détail de chaque action :
        aide alimentaire, maraudes, accompagnement, etc.)
      </p>
    </section>
  );
}

export default Actions;
